import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Home = () => {
    return (
        <View style={styles.container}>
            <View style={styles.home_Box}>
                <View style={styles.head}>
                    <Text style={styles.textStyle}>Services</Text>
                    <Text>Show All</Text>
                </View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        width: '100vw',
        height: '60vh',
        backgroundColor: "#fff",
    },
    home_Box: {
        width: '100vw',
        height: '100vh',
        backgroundColor: "#000",
        borderTopRightRadius: '5%',
        margin: 'auto',
    },
    textStyle: {
        color: "#102C56",
        fontSize: '18px',
        fontWeight: '500',
        lineHeight: '14px',
        letterSpacing: '2%',
    }
})

export default Home;
